import dataRecipes from "../data/data.json"

const Recipes = () => {
  return (
    <>
    {/* title bar */}
    <div className="contentTitle">
      <ul className="title-recipes">
        <li>Name</li>
        <li>Calories</li>
        <li>Image</li>
        <li>Servings</li>
      </ul>
    </div>


     {/* list of recipes */}

     <List recipes={dataRecipes}/>
    </>
  )
}

export default Recipes
